import React, {Component} from "react";
import {Card, Grid} from 'semantic-ui-react';
import Container from './Container';
import Header from './Header';
import BalanceCard from './BalanceCard';
import DonationCard from './DonationCard';
import MemberCard from './MemberCard';

import { makeStyles } from '@material-ui/core/styles'


function  getInitialProps () {
    const info = [
        {
            header: 'Alex',
            meta: 'Miembro 1',
            description: 'Empresa de telefonía'
        },
        {
            header: 'Ana',
            meta: 'Miembro  2',
            description: 'Empresa inversora en I+D'
        },
        {
            header: 'Javi',
            meta: 'Miembro 3',
            description: 'Añadir info'
        },
        {
            header: 'Ángeles',
            meta: 'Miembro 4',
            description: 'Empresa de telefonía'
        },
        {
            header: 'Jorge',
            meta: 'Miembro 5',
            description: 'Empresa inversora en I+D'
        },
        {
            header: 'David',
            meta: 'Miembro 6',
            description: 'Empresa especializada en consultoría'
        }

    ];
    return {info};
    //es lo mismo que poner return{campaings:campaigns}
}


function renderInfo(){
    const info = [
        {
            header: 'Ana Belén Duarte',
            meta: 'Estudiante',
            description: 'Añadir info'
        },
        {
            header: 'Mª Ángeles Plaza',
            meta: 'Estudiante',
            description: 'Añadir info'
        },
        {
            header: 'Alejandro Ramírez',
            meta: 'Estudiante',
            description: 'Añadir info'
        },
        {
            header: 'David Seijas',
            meta: 'Estudiante',
            description: 'Añadir info'
        },
        {
            header: 'Jorge del Valle',
            meta: 'Estudiante',
            description: 'Añadir info'
        },
        {
            header: 'Javier Verde',
            meta: 'Estudiante',
            description: 'Añadir info'
        }

    ];
    return <Card.Group items = {info} />;
}




const useStyles = makeStyles((theme) => ({
    root: {
      backgroundColor: theme.palette.primary.main
    },

  }));


function Info (){

    const theme = useStyles();
    return (
        <div className={theme.root}>
            <Grid>
                <Grid.Row>
                    <Grid.Column width = {16}>
                        <Header/>
                    </Grid.Column>
                </Grid.Row>
                <Grid.Column width = {8}>
                    <Grid>
                    <Grid.Row columns = {2}>
                                <Grid.Column stretched>
                                    <BalanceCard/>
                                </Grid.Column>
                                <Grid.Column stretched>
                                    <DonationCard/>
                                </Grid.Column>
                            </Grid.Row>
                    <Grid.Row>
                        <Grid.Column>
                            <Container/>
                        </Grid.Column>
                    </Grid.Row>
                    </Grid>
                </Grid.Column>
                <Grid.Column width = {4} >
                    <Grid.Row>
                        <Grid.Column width = {4} >
                            <MemberCard i={0}/>
                        </Grid.Column>
                    </Grid.Row>
                    <Grid.Row>
                        <Grid.Column width = {4} >
                            <MemberCard i={1}/>
                        </Grid.Column>
                    </Grid.Row>
                    <Grid.Row>
                        <Grid.Column width = {4} >
                            <MemberCard i={2}/>
                        </Grid.Column>
                    </Grid.Row>
                    </Grid.Column>
                    <Grid.Column width = {4} >

                        <Grid.Row>
                            <Grid.Column width = {4} >
                                <MemberCard i={3}/>
                            </Grid.Column>

                        </Grid.Row>
                        <Grid.Row></Grid.Row>
                        <Grid.Row>
                            <Grid.Column width = {4} >
                                <MemberCard i={4}/>
                            </Grid.Column>

                        </Grid.Row>
                        <Grid.Row ></Grid.Row>
                        <Grid.Row>
                            <Grid.Column width = {4} >
                                <MemberCard i={5}/>
                            </Grid.Column>

                        </Grid.Row>
                    </Grid.Column>


                </Grid>
            </div>

        )



}

export default Info;
